wit-bindgen is a tool to generate guest language bindings from a given .wit file. Although it is less integrated into language toolchains than other tools such as cargo-component, it can currently generate source-level bindings for Rust, C, Java (TeaVM), and TinyGo, with the ability for more language generators to be added in the future. wit-bindgen can be used to generate C applications that can be compiled directly to Wasm modules using clang with a wasm32-wasi target. First, install the CLI for wit-bindgen , wasm-tools , and the WASI SDK . The WASI SDK will install a local version of clang configured with a wasi-sysroot. Follow these instructions to configure it for use. Note that you can also use your installed system or emscripten clang by building with --target=wasm32-wasi but you will need some artifacts from WASI SDK to enable and link that build target (more information is available in WASI SDK's docs). Start by generating a C skeleton from wit-bindgen using the sample add.wit file : >wit-bindgen c add.wit
Generating "example.c"
Generating "example.h"
Generating "example_component_type.o" This has generated several files - an example.h (based on the name of your world) with the prototype of the add function - int32_t example_add(int32_t x, int32_t y);, as well as some generated code in example.c that interfaces with the component model ABI to call your function. Additionally, example_component_type.o contains object code referenced in example.c from an extern that must be linked via clang. Next, create an add.c that implements your function defined in example.h: #include "example.h" int32_t example_add(int32_t x, int32_t y)
{ return x + y;
} Now, you can compile the function into a Wasm module via clang: clang add.c example.c example_component_type.o -o add-core.wasm -mexec-model=reactor Use the clang included in the WASI SDK installation, for example at <WASI_SDK_PATH>/bin/clang. Next, you need to transform the module into a component. For this example, you can use wasm-tools component new: wasm-tools component new ./add-core.wasm -o add-component.wasm Do note this will fail if your code references any WASI APIs that must be imported. This requires an additional step as the WASI SDK still references wasi_snapshot_preview1 APIs that are not compatible directly with components. For example, modifying the above to reference printf() would compile: #include "example.h"
