Packaging reusable functionality into WebAssembly components isn't useful if we have no way to expose that functionality. This section offers a slightly deeper dive into the usage of WIT in WebAssembly components that can use the Component Model. As in the previous example, exporting WIT interfaces for other components (or a WebAssembly host) to use is fundamental to developing WebAssembly programs. Let's examine a jco example project called string-reverse that exposes functionality for reversing a string. To build a project like string-reverse from the ground up, first we'd start with a WIT like the following: package example:string-reverse@0.1.0 @since(version = 0.1.0)
interface reverse { reverse-string: func(s: string) -> string;
} world string-reverse { export reverse;
} As a slightly deeper crash course on WIT , here's what the above code describes: We've defined a namespace called example We've defined a package called string-reverse inside the example namespace This WIT file corresponds to version 0.1.0 of example:string-reverse package We've defined an interface called reverse which contains one function called reverse-string We specify that the reverse interface has existed since the 0.1.0 version The reverse-string function (AKA. example:reverse-string/reverse.reverse-string) takes a string and returns a string We've defined a world called string-reverse which exports the functionality provided by the reverse interface warning How do we know that reverse actually reverses a string? Unfortunately, that problem is not really solvable at this level -- this is between you and the writer of the component that implements the WIT interface. Of course, with WebAssembly, you can enforce static checks if you're so inclined, before you run any given binary. OK now let's see what the JS code looks like to implement the component world: /** * This module is the JS implementation of the `string-reverse` WIT world */ /** * This Javascript will be interpreted by `jco` and turned into a * WebAssembly binary with a single export (this `reverse` function). */
function reverseString(s) { return s.reverse();
} /** * The Javascript export below represents the export of the `reverse` interface, * which which contains `reverse-string` as it's primary exported function. */
export const reverse = { reverseString,
}; note To view the full code listing along with instructions, see the examples/tutorials/jco/string-reverse folder To use jco to compile this component, you can run the following from the string-reverse folder: npx jco componentize \ string-reverse.mjs \ --wit wit/component.wit \ --world-name component \ --out string-reverse.wasm \ --disable all note Like the previous example, we're not using any of the advanced WebAssembly System Interface features, so we --disable all of them Rather than typing out the jco componentize command manually, you can also run the build command with npm run build from the string-reverse folder . You should see output like the following: OK Successfully written string-reverse.wasm. Now that we have a WebAssembly binary, we can also use jco to run it in a native Javascript context by transpiling the WebAsssembly binary (which could have come from anywhere!) to a Javascript module. npx jco transpile string-reverse.wasm -o dist/transpiled You should see the following output: Transpiled JS Component Files: - dist/transpiled/interfaces/example-string-reverse-reverse.d.ts 0.1 KiB - dist/transpiled/string-reverse.core.wasm 10.1 MiB - dist/transpiled/string-reverse.d.ts 0.15 KiB - dist/transpiled/string-reverse.js 2.55 KiB tip A gentle reminder that, transpilation does produce Typescript declaration file , for use in Typescript projects. Now that we have a transpiled module, we can run it from any Javascript context that supports core WebAssembly (whether NodeJS or the browser). For NodeJS, we can use code like the following: // If this import listed below is missing, please run `npm run transpile`
import { reverse } from "./dist/transpiled/string-reverse.mjs"; const reversed = reverse.reverseString("!dlroW olleH"); console.log(`reverseString('!dlroW olleH') = ${reversed}`); note In the jco example project, you can run npm run transpiled-js to build the existing code. Assuming you have the dist/transpiled folder populated (by running jco transpile in the previous step), you should see output like the following: reverseString('!dlrow olleh') = hello world! While it's somewhat redundant in this context, what we've done from NodeJS demonstrates the usefulness of WebAssembly and the jco toolchain. With the help of jco, we have: Compiled Javascript to a WebAssembly module (jco compile), adhering to an interface defined via WIT Converted the compiled WebAssembly module (which could be from any language) to a module that can be used from any compliant JS runtime (jco transpile) Run the transpiled WebAssembly component from a Javascript native runtime (NodeJS)

