Just as exporting functionality is core to building useful WebAssembly components, and similarly importing and reusing functionality is key to using the strengths of WebAssembly. Restated, WIT and the Component Model enable WebAssembly to compose . This means we can build on top of functionality that already exists and export new functionality that depends on existing functionality. Let's say in addition to the reversing the string (in the previous example) we want to build shared functionality that also upper cases the text it receives. We can reuse the reversing functionality and export a new interface which enables us to reverse and upper-case. Let's examine a jco example project called string-reverse-upper that exposes functionality for reversing and upper-casing a string. Here's the WIT one might write to enable this functionality: package example:string-reverse-upper@0.1.0; @since(version = 0.1.0)
interface reversed-upper { reverse-and-uppercase: func(s: string) -> string;
} world revup { // // NOTE, the import below translates to: // <namespace>:<package>/<interface>@<package version> // import example:string-reverse/reverse@0.1.0; export reversed-upper;
} This time, the world named revup that we are building relies on the interface reverse in the package string-reverse from the namespace example. We can make use of any WebAssembly component that matches that interface, as long as we compose their functionality with the component that implements the revup world. The revup world imports (and makes use) of reverse in order to export (provide) the reversed-upper interface, which contains the reverse-and-uppercase function (in JS, reverseAndUppercase). note Functionality is imported from the interface, not the world. worlds can be included/used, but the syntax is slightly different for that. The Javascript to make this work ( string-reverse-upper.mjs in jco/examples ) looks like this: /** * This module is the JS implementation of the `revup` WIT world */ /** * The import here is *virtual*. It refers to the `import`ed `reverse` interface in component.wit. * * These types *do not resolve* when the first `string-reverse-upper` component is built, * but the types are relevant for the resulting *composed* component. */
import { reverseString } from 'example:string-reverse/reverse@0.1.0'; /** * The Javascript export below represents the export of the `reversed-upper` interface, * which which contains `revup` as it's primary exported function. */
export const reversedUpper = { /** * Represents the implementation of the `reverse-and-uppercase` function in the `reversed-upper` interface * * This function makes use of `reverse-string` which is *imported* from another WebAssembly binary. */ reverseAndUppercase() { return reverseString(s).toLocaleUpperCase(); },
}; We can build the component with jco componentize: npx jco componentize \ string-reverse-upper.mjs \ --wit wit/ \ --world-name revup \ --out string-reverse-upper.incomplete.wasm \ --disable all While we've successfully built a WebAssembly component, unlike the other examples, ours is not yet complete . We can see that if we print the WIT of the generated component by running jco wit: npx jco wit string-reverse-upper.incomplete.wasm You should see output like the following: package root:component; world root { import example:string-reverse/reverse@0.1.0; export example:string-reverse-upper/reversed-upper@0.1.0;
} This tells us that the component still has unfulfilled imports -- we use the reverseString function that's in reverse as if it exists, but it's not yet a real part of the WebAssembly component (hence we've named it .incomplete.wasm. To compose the two components (string-reverse-upper/string-reverse-upper.incomplete.wasm and string-reverse/string-reverse.wasm we built earlier), we'll need the WebAssembly Composition tool (wac) . We can use wac plug: wac plug \ -o string-reverse-upper.wasm \ --plug ../string-reverse/string-reverse.wasm \ string-reverse-upper.incomplete.wasm note You can also run this step with npm run compose. A new component string-reverse-upper.wasm should now be present, which is a "complete" component -- we can check the output of jco wit to ensure that all the imports are satisfied: package root:component; world root { export example:string-reverse-upper/reversed-upper@0.1.0;
} It's as-if we never imported any functionality at all -- the functionality present in string-reverse.wasm has been merged into string-reverse-upper.wasm, and it now simply exports the advanced functionality. We can run this completed component with in any WebAssembly-capable native Javascript environment by using a the transpiled result: npx jco transpile string-reverse-upper.wasm -o dist/transpiled note In the example project, you can run npm run transpile instead, which will also change the extension on dist/transpiled/string-reverse-upper.js to .mjs You should see output like the following: Transpiled JS Component Files: - dist/transpiled/interfaces/example-string-reverse-upper-reversed-upper.d.ts 0.12 KiB - dist/transpiled/string-reverse-upper.core.wasm 10.1 MiB - dist/transpiled/string-reverse-upper.core2.wasm 10.1 MiB - dist/transpiled/string-reverse-upper.d.ts 0.19 KiB - dist/transpiled/string-reverse-upper.js 6.13 KiB tip Notice that there are two core WebAssembly files? That's because two core WebAssembly modules were involved in creating the ultimate functionality we needed. To run the transpiled component, we can write code like the following: /** * If this import listed below is missing, please run * * ``` * npm run build && npm run compose && npm run transpile` * ``` */
