When you compose components, you wire up the imports of one "primary" component to the exports of one or more other "dependency" components, creating a new component. The new component, like the original components, is a .wasm file, and its interface is defined as: The new component exports the same exports as the primary component The new component does not export the exports of the dependencies The new component imports all the imports of the dependency components The new component imports any imports of the primary component imports that the dependencies didn't satisfy If several components import the same interface, the new component imports that interface - it doesn't "remember" that the import was declared in several different places For example, consider two components with the following worlds: // component `validator`
package docs:validator@0.1.0; interface validator { validate-text: func(text: string) -> string;
} world validator { export validator; import docs:regex/match@0.1.0;
} // component 'regex'
package docs:regex@0.1.0; interface match { first-match: func(regex: string, text: string) -> string;
} world regex { export match;
} If we compose validator with regex, validator's import of docs:regex/match@0.1.0 is wired up to regex's export of match. The net result is that the composed component exports docs:validator/validator@0.1.0 and has no imports. The composed component does not export docs:regex/match@0.1.0 - that has become an internal implementation detail of the composed component. Component composition tools are in their early stages right now. Here are some tips to avoid or diagnose errors: Composition happens at the level of interfaces. If the initial component directly imports functions, then composition will fail. If composition reports an error such as "component path/to/component has a non-instance import named <name>" then check that all imports and exports are defined by interfaces. Composition is asymmetrical. It is not just "gluing components together" - it takes a primary component which has imports, and satisfies its imports using dependency components. For example, composing an implementation of validator with an implementation of regex makes sense because validator has a dependency that regex can satisfy; doing it the other way round doesn't work, because regex doesn't have any dependencies, let alone ones that validator can satisfy. Composition cares about interface versions, and current tools are inconsistent about when they infer or inject versions. For example, if a Rust component exports test:mypackage, cargo component build will decorate this with the crate version, e.g. test:mypackage@0.1.0. If another Rust component imports an interface from test:mypackage, that won't match test:mypackage@0.1.0. You can use wasm-tools component wit to view the imports and exports embedded in the .wasm files and check whether they match up.

